import React from "react";
import { useSelector } from "react-redux/es/exports";
const Show = () => {
  const selector = useSelector((state) => state.crudReducer.list);
  console.log("Show", selector);
  return (
    <div>
      Show
      <table style={{ border: "1px solid black", borderCollapse: "collapse" }}>
        <tr style={{ border: "1px solid black", borderCollapse: "collapse" }}>
          <th style={{ border: "1px solid black", borderCollapse: "collapse" }}>Name: </th>
          <th style={{ border: "1px solid black", borderCollapse: "collapse" }}>Contact Number: </th>
        </tr>
        {selector.map((item, ind) => {
          return (
            <tr >
              <td style={{ border: "1px solid black", borderCollapse: "collapse" }}>{item.Name}</td>
              <td style={{ border: "1px solid black", borderCollapse: "collapse" }}>{item.ContactNumber}</td>
            </tr>
          );
        })}
      </table>
    </div>
  );
};

export default Show;
